import React  from "react";


function EmptyCart () {
    return(
        <div className="container mt-5">
            <div className="row">
                <div className="col-10 mx-auto text-center">
                    <h1> Your Shopping Cart is currently empty</h1>
                </div>
            </div>
        </div>
    );
}
export default EmptyCart;
